import ExpenseItem from "./components/ExpenseItem";

function App() {
  expense=[
    {title:'car insurence',amount:'$123',date:'30 01 2022'},
    {title:'toilet tissue',amount:$100,date:'31 01 2022'},
    {title:'grocery',amount:$190,date:'3 02 2022'},
    {title:'council tax',amount:$160,date:'6 02 2022'}
  ]
  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItem title={expense[0].title} amount={expense[0].amount} date={expense[0].date}></ExpenseItem>
      <ExpenseItem title={expense[1].title} amount={expense[0].amount} date={expense[0].date}></ExpenseItem>
      <ExpenseItem title={expense[2].title} amount={expense[0].amount} date={expense[2].date}></ExpenseItem>
      <ExpenseItem title={expense[3].title} amount={expense[3].amount} date={expense[3].date}></ExpenseItem>
    </div>
  );
}

export default App;
